import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';


const myfirstelement = <h1>Hello React!</h1>

ReactDOM.render(myfirstelement, document.getElementById('root'));

class Header extends React.Component {
    render() {
        return (
            <nav className="w3-top" style="width:100%;overflow:hidden; z-index: 2">
                <div className="w3-bar w3-black  w3-card" id="myNavbar">
                    <a href="/" className="w3-bar-item"
                       style="padding: 8px 16px; font-family: 'Gloria Hallelujah', cursive; font-weight: 100; font-size: x-large;  text-decoration: none;">
                        astro-problems
                    </a>

                    <div className="w3-right w3-hide-small w3-hide-medium">
                        <a href="index.html" class="w3-bar-item w3-button w3-padding-16">Главная</a>
                        <a href="{% url 'problems:problems_list' 'id' 0 %}"
                           className="w3-bar-item w3-button w3-padding-16"><i className="fab fa-wpexplorer"></i> Задачи</a>
                        <a href="{% url 'problems:authors_list' %}" className="w3-bar-item w3-button w3-padding-16"><i
                            className="far fa-user"></i> Авторы</a>
                        <a href="{% url 'problems:themes_list' %}"
                           className="w3-bar-item w3-button w3-padding-16"><i
                            className="far fa-compass"></i> Темы</a>
                        <a href="{% url 'problems:events_list' %}"
                           className="w3-bar-item w3-button w3-padding-16"><i className="fas fa-map-marker-alt"></i>
                            Источники</a>
                        <a href="{% url 'problems:search' %}"
                           className="w3-bar-item w3-button w3-padding-16"><i className="fa fa-search"></i>
                            Поиск</a>


                    </div>



                </div>
            </nav>
        )
    }
}

ReactDOM.render(<Header />, document.getElementById('header'))
